import React from 'react';
import './Dice.css';

const Dice = ({ value }) => {
  return (
    <div className="dice">
      {value ? (
        <div className="dice-value">{value}</div>
      ) : (
        <div className="dice-placeholder">?</div>
      )}
    </div>
  );
};

export default Dice;
